(2, 'send-bed-allotment-detail', 'Placio - Boarding Pass ', 'Placio', 'hello@placio.in', '<table style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; font-size: 15px; width: 100%; background: #f2f2f2; margin: 0; padding: 0;\">\r\n<tbody>\r\n<tr style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; font-size: 14px; margin: 0; padding: 0;\">\r\n<td style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; vertical-align: top; display: block!important; max-width: 600px!important; clear: both!important; margin: 0 auto; padding: 0;\" valign=\"top\" width=\"600\">\r\n<div style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; max-width: 600px; display: block; margin: 0 auto; padding: 20px;\">\r\n<table style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; border-radius: 3px; background: #fff; margin: 0; padding: 0; border: 1px solid #e9e9e9;\" width=\"100%\" cellspacing=\"0\" cellpadding=\"2\">\r\n<tbody>\r\n<tr style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; margin: 0; padding: 0;\">\r\n<td style=\"text-align: center; box-sizing: border-box; vertical-align: middle; margin: 0; padding: 18px 30px 0px 30px;\" valign=\"center\">\r\n<div style=\"border-bottom: 1px solid #e5e5e5; padding-bottom: 5px; text-align: center;\"><a style=\"text-decoration: none; display: inline-block;\" href=\"#\" target=\"_blank\"> <img style=\"width: 25%;\" src=\"{{base_url}}{{logo_name}}\" alt=\"Placio\" /> </a></div>\r\n</td>\r\n</tr>\r\n<tr style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; margin: 0; padding: 0;\">\r\n<td style=\"font-family: \'Open Sans\', Helvetica, Helvetica, Arial, sans-serif; box-sizing: border-box; vertical-align: top; margin: 0px; padding: 5px 30px 30px;\" valign=\"top\">\r\n<p>Greetings!!!&nbsp;</p>\r\n<p>{{tenant_name}}</p>\r\n<p>Congratulations,</p>\r\n<p>You are now onboarded for Placio Living.&nbsp;</p>\r\n<p>Kindly keep following details for an Amazing&nbsp;Placio Family experience&nbsp;--</p>\r\n<table border=\"1\" width=\"100%\" cellspacing=\"0\" cellpadding=\"5\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 35%; padding: 10px;\">Tenant ID</td>\r\n<td>&nbsp; {{tnt_id}}</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">Placio Property Name</td>\r\n<td>&nbsp; {{property_name}}</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">Floor No</td>\r\n<td>&nbsp; {{floor_no}}</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">Room No.</td>\r\n<td>&nbsp; {{room_no}}</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">Bed No.</td>\r\n<td>&nbsp; {{bed_no}}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br />To Connect with your Community Manager Please note the details:-</p>\r\n<table border=\"1\" width=\"100%\" cellspacing=\"0\" cellpadding=\"5\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 35%; padding: 10px;\">Manager Name</td>\r\n<td>&nbsp; {{cm_name}}</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">Contact details</td>\r\n<td>&nbsp; {{cm_mobile_no}}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong><br />Payment Instructions:<br /></strong></p>\r\n<p><strong>1. E-collect :-</strong>&nbsp;(*preferred)</p>\r\n<p>RTGS/NEFT/IMPS transfer can be made directly from bank account for which Following Procedure to be followed:-</p>\r\n<table border=\"1\" width=\"100%\" cellspacing=\"0\" cellpadding=\"5\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 35%; padding: 10px;\">Beneficiary Name</td>\r\n<td>&nbsp; Rental Stay Private Limited</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">Account No.</td>\r\n<td>&nbsp;{{account_no}}</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 10px;\">IFSC Code</td>\r\n<td>&nbsp;YESB0CMSNOC</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong><br />2. Card/UPI/Wallets :-</strong></p>\r\n<p style=\"text-align: left;\">Collection through Card/UPI/Wallets/net banking is available online on</p>\r\n<p style=\"text-align: center;\"><a style=\"background: #4bd074; border-collapse: collapse!important; border: none; color: #ffffff; display: block; font-family: \'Helvetica\',\'Arial\',sans-serif; font-size: 14px; font-weight: normal; line-height: 19px; margin: 18px 32px 28px 140px; padding: 8px 0; text-align: center; vertical-align: top; width: 40%;\" title=\"Pay Now\" href=\"https://www.placio.in/payrent?feesetid={{fee_setting_id}}\" target=\"_blank\">PAY NOW</a></p>\r\n<p>Thanks &amp; Regards, <br /> {{site_name}}</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; font-size: 14px; width: 100%; clear: both; color: #999; margin: 0; padding-top: 20px; padding-bottom: 20px;\">\r\n<table style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; font-size: 14px; margin: 0; padding: 0;\" width=\"100%\">\r\n<tbody>\r\n<tr style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; font-size: 14px; margin: 0; padding: 0;\">\r\n<td style=\"font-family: \'Open Sans\',\'Helvetica\',Helvetica,Arial,sans-serif; box-sizing: border-box; font-size: 12px; vertical-align: top; text-align: center; margin: 0; padding: 0 0 20px;\" align=\"center\" valign=\"top\"><a style=\"text-decoration: none; display: inline-block; margin-right: 5px;\" href=\"{{facebook_url}}\" target=\"_blank\"> <img title=\"facebook\" src=\"{{base_url}}hms/img/social/email/facebook.png\" alt=\"facebook\" width=\"30\" /> </a> <a style=\"text-decoration: none; display: inline-block; margin-right: 5px;\" href=\"{{linkedin_url}}\" target=\"_blank\"> <img title=\"linkedin\" src=\"{{base_url}}hms/img/social/email/linkedin.png\" alt=\"linkedin\" width=\"30\" /> </a> <a style=\"text-decoration: none; display: inline-b