(29, 29, 'Placio Vinayaka', 'pg', 'male', 'Placio Vinayaka offers impeccable, fully furnished rooms on double & triple sharing basis for male students. What makes this property an ideal choice for \'Kautilya Academy\' students is the easy distance at which it is located. The room at Placio Vinayaka is equipped with all the modern comforts. All the rooms have cupboards, good quality bedding, and attached bathrooms with solar geysers. Placio Vinayaka additionally offers room cleaning and warden services. 24x7 power backup, high-speed broadband connectivity, parking for residents, three meals a day, study tables and chairs are some other features that give Placio Vinayaka a home like touch.', '27,30,31,70,71,72,73,74,79,87,89,93,94,96,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '', '6500', '6350', ''),
(31, 31, 'Placio Nightingale', 'pg', 'male', 'Placio Nightangle offers impeccable, fully furnished rooms on double occupancy and triple occupancy for male students. What makes this property an ideal choice for students is the easy distance at which it is located. The rooms at Placio Nightangle are equipped with all the modern comforts that will make the Institutional tenure of students at Institutes a memorable and comfortable experience. All the rooms have cupboards, good quality bedding, and attached bathrooms. Placio Nightangle additionally offers room cleaning and warden services. 24x7 power backup, high-speed broadband connectivity, parking for residents, three meals a day, study tables and chairs are some other features that give Placio Nightangle a home like touch.', '27,31,63,66,71,72,73,74,77,79,86,87,88,89,92,93,94,96,98,101,105,106', '11:45 AM', '11:45 AM', '1', '1', '1', '1', '8500', '8000', '8000', '7500'),
(32, 32, 'Placio Precious', 'pg', 'female', 'At Placio Precious, we pride ourselves in balancing the warmth of home with the energy of the student life by offering fully-furnished rooms in Indra Nagar on double sharing basis, state-of-the-art amenities, and exceptional service. This is secured student housing complex with fabulous facilities, fully furnished and equipped offering fully furnished AC room offer the privacy of your own bathroom, closet, bed, study desk and chair. Basic amenities like laundry, housekeeping, WiFi, drinking water, 24x7 power back-up are provided which make your stay comfortable and pleasant. We also bring you safe, secure housing ensured by monitored CCTV cameras installed at various location on site, plus phone line for connectivity with parents. Your health is of concern to us and we have taken the responsibility to provide nutritious in-house meals in the dining areas. You can look to us to help make your living experience one that you will remember well past your college years. But most of all, our staff is always on hand to take care of maintenance issues, organise social events, and generally help you out. The residency is situated in an ideal location within walking distance from local shopping, dining, and entertainment destinations. What are you waiting for? Be the first to experience this off-campus gem. Reserve your spot today...while they last!', '29,31,34,66,70,73,74,86,87,88,89,94,96,99,105,106', '10:00 AM', '08:00 PM', '1', '1', '1', '1', '', '10000', '', ''),
(33, 33, 'Placio Shresth Homes', 'pg', 'female', 'Placio Shresth Homes is a female-only student housing property located close by to Amity University, Sector 125, Noida. The property offers three types of fully furnished accommodation options to Amity students - Single Room, Double Room, and Three-Bed Room. All these rooms are carefully designed to provide ample space to the students, making them feel comfortable and at home. These rooms come equipped with pre-installed cupboards, private bathrooms with geyser, clean and soft bedding, delicious breakfast, and parking space for bikes to ensure that your college years remain the best phase of your life. Placio Shrestha also provides its residents with other basic amenities and ensures a clean and healthy environment for anybody who calls it their home.', '27,30,31,34,66,70,71,72,73,74,77,79,86,87,88,89,92,93,94,95,96,97,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '26000', '18000', '16000', ''),
(34, 34, 'Placio Elite Homes 2', 'pg', 'female', 'Located at a throwaway distance from Amity University Noida, Sector 125, Placio Elite Homes 2 is a blessing in disguise for all those female students who have taken admissions in Amity and are looking for decent accommodation. This female student housing facility offers double rooms with a private bathroom, air conditioner, organised cupboard, ample bedding, and breakfast and lunch for a comfortable college year at Amity. This Placio verified property is located in Sector 126 and comes equipped with a bike parking facility, laundry services, room cleaning service, and a warden facility. Since it is a female-only student housing facility, Placio Elite Homes 2 ensures the safety of each and every resident like its daughters.', '28,29,30,31,34,66,68,69,70,71,72,73,74,77,79,86,87,88,89,93,94,95,96,97,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '', '16000', '', ''),
(35, 35, 'Placio AK Mansion', 'pg', 'male', 'Placio AK Mansion, a verified and safe student housing facility, is located in Sant Nagar at a close distance to all the big institute like Kautilya Academy located near Sant Nagar. Student can choose from Triple Occupancy and Quad Occupancy, both of which come installed with bedding, cupboards, and attached bathrooms with geysers. This Placio verified property is located in 21 Sant Nagar, Near Sant Nagar Gurudwara, Indore Madhya Pradesh-452001 and comes equipped with room cleaning service, and a warden facility. All in all, Placio AK Mansion provides a home-like comfort to students starting a new and important chapter of their lives in Institutional Hub.', '27,31,34,62,66,70,71,72,73,74,77,79,87,88,89,93,94,96,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '', '', '6500', '6500'),
(36, 36, 'Placio Princess', 'pg', 'female', 'One of the newest additions to Placio Housing in Lucknow, Placio Princess is a female only accommodation with chic finishes, convenient location next to Amity University making it undoubtedly an ideal destination for premier off-campus living designed with students in mind. The fully-furnished AC rooms on double sharing basis are certain to satisfy just about any student. These come with attached bathroom equipped with geyser. The room also has soft mattress and pillow, beds, study desk and chair. Other premier amenities are Wi-Fi, drinking water, laundry, housekeeping and onsite maintenance services. Placio puts community and quality of life at the forefront of everything we do by providing comfortable and secure residences with monitored CCTVs, 24x7 security, warden and parental helpline. There is also provision of tasty and nutritious in-house meals also in dining area. Quiet, generously sized and fully equipped spaces strengthen strong study habits because Placio Princess  is owned and operated by Placio who are the leading student accommodation provider in India so you can rest-assured that you are well-supported.  Our people are experienced, passionate and knowledgeable about student life; theres not much they havent seen. Whether its directions to the bus stop you need or something more serious, theyll be there to help. If things arent working out with your flat mates, theyll do everything they can to help you sort it out or find you another room. Come enjoy your stay here.', '31,34,66,71,72,73,74,87,88,89,94,96,101', '10:00 AM', '08:00 PM', '1', '1', '1', '1', '', '10000', '', ''),
(37, 37, 'Placio Pinnacle ', 'pg', 'female', 'Placio Pinnacle is a girls only housing offers safe, secure, high quality, en-suite accommodation a few minutes walk from the university. Placio is redefining student housing because we have the insight to create places to live where you can feel at home, no matter where youve come from or where you want to go. We provide fully curated, managed accommodation designed for women students pursuing their studies in Lucknow offers the most hassle-free option at an affordable allinclusive rate located close by to BBD University. These are fully furnished spacious, comfortable, well-ventilated AC rooms on double sharing basis, equipped with pre-installed cupboards, study desk and chair, beds along with clean and soft beddings.    Placio Pinnacle offers WiFi, laundry services, 24x7 helpline, CCTV, power backup, parent helpline for a comfortable stay making this the best choice for female students as the place has a warm welcoming, open and clean environment which fosters friendship, solidarity and mutual respect along with healthy, nutritious and tasty food. Security is built into the design of all our accommodation. Whatever the problem, youll see a team of friendly faces throughout the day who can help you sort out your problem from our front desk staff, including maintenance staff, housekeepers, security staff and a dedicated Placio team trained to deal with any issue. ', '29,31,34,66,71,72,73,74,86,87,88,89,93,94,96,98,101,105,106', '10:00 AM', '08:00 PM', '1', '1', '1', '1', '', '10000', '', ''),
(38, 38, ' Placio Home Care SL02', 'pg', 'male', 'Placio proudly welcomes male students from all over India to spacious, comfortable, affordable, and safe student housing in Noida at Placio Home Care SL-12. All of our accommodations are fully furnished AC rooms on double sharing basis, with a variety of unparallel amenities. These are equipped with beds, pre-installed cupboards, study desk and chair, clean and soft beddings.  These are spacious, comfortable, well ventilated rooms having an attached bathroom, refrigerator and more.  WiFi, laundry services, housekeeping services, 24x7 helpline, CCTV, power backup, common TV, prepaid electrify metre, drinking water, 24x7 power backup plus parent helpline are provided for a comfortable stay. If you need a roommate, we will find a good match for you. With us, you will only have to focus on studying; we will take care of your housing need. We have high level of security because we want to make sure our residents feel safe and secure. Placio is about supporting students who live with us, in a way that represents all of their best interests of comfort, health and well-being. All this involves making you feel safe and comfortable.  Your security is of prime importance, which we insure with CCTV cameras installed on premises, security and guards on site. A selection of communal spaces are open to all residents for studying and socialising like dining area for in house meals. Our exceptional customer service, affordable pricing and ideal location set us apart from others and creates a community that you will be proud to call \"home\".', '27,29,30,31,34,66,71,73,74,77,79,86,87,88,89,92,93,94,95,96,97,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '', '17000', '', ''),
(40, 40, 'Placio Home Care KO-17 ', 'pg', 'male', 'Placio offers a stylish selection of fully furnished accommodation, designed specifically for students. Home Care KO-17 redefines student living with upscale luxurious housing for boys. Working on your college degree doesnt have to be a bore. Come for fun-filled student living! Take a room here to have access to an exclusive amenity package thats simply too good to ignore, visit and fall in love with our lavish cafe and lounge. \r\nHome Care KO 17 is a secured and comfortable student housing for boys with biometric entry. Luxurious fully-furnished AC rooms on double sharing basis are equipped with beds, closet, study desk with a chair, and a sink in sofa, TV with DTH and fridge. Indulge in the in-house dining experience in a spacious dining area or eat in the mess per your wish. There are no worries about laundry, cleaning as we provide housekeeping services or maintenance.  Accommodation here is more than four walls and a roof it is a home where safety, comfort and well-being are main elements at Home Care KO-17. Fire safety and security has been given paramount importance. CCTV cameras are monitored and we have 24x7 security guards. Another plus is this property is located near university and public transports. Experience the joys of living with us!\r\n', '28,29,30,31,34,66,68,70,71,72,73,74,77,79,86,87,88,89,91,93,94,95,96,97,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '', '17000', '', ''),
(41, 41, 'Placio Home Care KO-11', 'pg', 'male', 'Home Care KO-11 is student housing in Sector 126, Noida designed with boys in mind so that you can focus on studies and enjoy yourself. Placio aims for providing the best environment for our resident students because we understand the needs and wish to ensure that you have a comfortable stay. We offer fully furnished AC rooms on twin sharing basis, so youre immediately provided with all necessary comforts when you move in. To ensure that you feel at home we provide beds, comfortable and clean mattresses & pillows with linen, attached bathroom with geyser, Each room has its own TV, fridge, closets, tables and chairs. We want your stay to be comfortable and stress free so we provide all the basic amenities like laundry, housekeeping and maintenance. WiFi, drinking water, 24x7 power back-up are provided. Your health is of concern to us and we have taken the responsibility to provide nutritious and tasty in-house meals keeping your eating habits in mind. You will only need to bring your personal belonging and just move in. Your well being means security, which we have ensured with CCTV cameras installed at various location on site, plus phone line for connectivity with parents.  Contact us with any questions that you may have or visit our website to know more details. ', '30,31,34,66,71,72,73,74,77,79,86,87,88,89,92,93,94,95,96,97,98,101,105,106', '10:00 PM', '06:00 AM', '1', '1', '1', '1', '', '17000', '', ''),
