(82, 82, 'Placio Nirmal Residency', 'pg', 'female', 'Placio Nirmal Residency is a female-only student housing property located close by to Delhi University North Campus. The property offers four types of fully furnished accommodation options to DU Students - Single Occupancy, Double Occupancy, Three Occupancy and Quad Occupancy. All these rooms are carefully designed to provide ample space to the students, making them feel comfortable and at home. These rooms come equipped with pre-installed cupboards, private bathrooms with geyser, clean and soft bedding, delicious breakfast, to ensure that your college years remain the best phase of your life. Placio Nirmal Residency also provides its residents with other basic amenities and ensures a clean and healthy environment for anybody who calls it their home.', '27,30,31,34,66,71,72,73,74,77,79,86,87,88,89,93,94,96,97,98,101,105,106', '08:00 AM', '10:00 PM', '1', '1', '1', '1', '20000', '15000', '17500', '13000'),
