(85, 85, 'Bird House 1', 'pg', 'female', 'Placio Bird House 1 enhances female student living by providing balanced living. Placio is about supporting residents in a way that represents all of their best interests of comfort, health and well-being making them feel safe and comfortable.  We pride ourselves on the high quality of our accommodation and the friendly, personal service that residents will receive while staying with us. Placio believes residents should be able to relax while they are living and studying away from home, so we take all their needs into account to take the stress out of renting student accommodation. Hence we offer unparalleled amenities, starting from fully-furnished big and comfortable AC rooms on single and double sharing basis with attached bath. Each room has TV, closets, tables and chairs. Resident are also provided comfy mattress and soft fluffy pillows plus linen. Placio Bird House 1 offers homelike atmosphere, clean, safe and beautiful place with laundry, housekeeping, WiFi, drinking water, 24x7 power back-up.  Your security is of prime importance, which we insure with CCTV cameras installed on premises, security and guards and parent helpline. Along with this your health is of concern to us and we provide nutritious in-house meals. ', '27,30,31,34,66,70,71,72,73,74,77,79,86,88,89,93,94,96,97,98,101,105,106', '10:00 PM', '07:00 AM', '1', '1', '1', '1', '16000', '13000', '11500', ''),
(86, 86, 'Bird House 2', 'pg', 'female', 'Placio Bird House 2 is designed to give you a happy and comfortable base for your time in Delhi, taking your college experiences to the next level. This accommodation provides unbeatable location and professionally designed interiors, plus proximity to campuses and city life. Youll find new friends and plenty of quiet areas where you can focus on your studies. Here, we offer fully-furnished AC rooms with attached bathroom, bed, clean soft mattress & pillows, linen, chair and study desk along with TV and fridge in the room.  Placio Bird House 2 also offers high-speed WiFI, friendly staff, warden, laundry and cleaning services, in house nutritious meals leaving you to rest and relax knowing that well take care of everything during your stay. Your security is of prime importance, which we insure with CCTV cameras installed on premises, security and guards and parent helpline. Placio is about supporting students who live with us, in a way that represents all of their best interests of comfort, health and well-being. All this involves making you feel safe and comfortable as we strive to create fun, secure and high-quality accommodation for modern students. Sleek living spaces and bold social areas deliver sophisticated style with modern design.', '27,31,34,66,71,72,73,74,77,79,86,88,89,93,94,96,97,98,101,105,106', '10:00 PM', '07:00 AM', '1', '1', '1', '1', '', '14000', '12000', '');
